Red prawn pasta and sunset views are just a couple reasons to love @isolahk at @hkifcmall! 🦐🍝🌇 I just landed back in HK today and will def be seeking all the good food and views once I’m out of my 1 week hotel quarantine (details on my story!)

Isola is definitely one of my fave spots in the mall after a few visits, thanks to artful and delicious seafood dishes and now drinks by my man Waqas 🥃 They also just renovated the rooftop garden at the mall to take in those views even more! 🌅

@hkifcmall is also offering rebates of up to 110% off your purchase on dining and shopping when you spend at participating restaurants and shops - visit their profile or a concierge at the mall for details #IndulgentEatsHK
